import { Route, Switch } from "react-router-dom";
import Home from "./Home.tsx";
import CreateTxn from "./CreateTxn.tsx";

function Main() {
  return (
    <div className="content">
      <Switch>
      <Route exact path="/" component={Home} />
      <Route path="/create" component={CreateTxn} />
    </Switch>
    </div>
  );
}

export default Main;
